import React from 'react';

const Logo: React.FC = () => {
  return (
    <div className="flex items-center space-x-2 cursor-pointer" onClick={() => window.scrollTo({ top: 0, behavior: 'smooth' })}>
      <img 
        src="https://cdn-editing-temp.picsart.com/editing-temp-landings/858fa741-86c4-4bf0-ba94-7c22b2117818.png" 
        alt="Labmelo Logo" 
        className="h-8 w-auto"
      />
      <span className="text-xl font-bold bg-clip-text text-transparent bg-gradient-to-r from-custom-pastel-green via-custom-soft-pink to-custom-teal">
        Labmelo
      </span>
    </div>
  );
};

export default Logo;
